import React from "react";
 
const Popup = props => {
    console.log("props :",props)
  return (
    <div className="popup-box">
        {props.type==="error" &&
            <div className="box1">
                <span className="close-icon" onClick={props.handleClose}>x</span>
                {props.content}
            </div>
        }
        {props.type==="register" &&
            <div className="box2">
                <span className="close-icon" onClick={props.handleClose}>x</span>
                <p>Weldone, you're registration is in good way, you should soonly receive a metamask notification !</p>
                <p>#JeSaisPasGérerLesEventAvecEthersJs</p>
            </div>
        }
        {props.type==="submit" &&
            <div className="box2">
                <span className="close-icon" onClick={props.handleClose}>x</span>
                <p>Weldone, the registration of your proposal is in good way, you should soonly receive a metamask notification !</p>
                <p>#JeSaisPasGérerLesEventAvecEthersJs</p>
            </div>
        }
        {props.type==="submit" &&
            <div className="box2">
                <span className="close-icon" onClick={props.handleClose}>x</span>
                <p>Weldone, the registration of your proposal is in good way, you should soonly receive a metamask notification !</p>
                <p>#JeSaisPasGérerLesEventAvecEthersJs</p>
            </div>
        }
    </div>
  );
};
 
export default Popup;
